import React from 'react';
import Layout from '../components/Layout/Layout';
import CountryList from "../components/CountryList/CountryList";
import {countryProps, CountryContextProvider} from '../components/Countries/CountryInterface';
import Figure from "../components/Figure/Figure";

const Components = () => {
    const state: countryProps[] = [
        {
            id: 1,
            name: "Aruba",
            currency: "FL"
        },
        {
            id: 2,
            name: "Brazil",
            currency: "BRL"
        },
        {
            id: 3,
            name: "England",
            currency: "POUND"
        },
        {
            id: 4,
            name: "Japan",
            currency: "YEN"
        }
    ];
    return (
        <Layout page="Components">
            <CountryContextProvider value={state[name]}>
                <CountryList/>
                <Figure type="large"/>
                <Figure type="medium" />
                <Figure type="x-large"/>
            </CountryContextProvider>
        </Layout>
    )
};

export default Components;
